import React from "react";
import './Header_Home.css';
import img from '../../../images/user.png'
import { HashRouter as Router, Route, Routes } from 'react-router-dom';
import Main_Home_File from '../../Main_Screen_Files/Main_Home_File'
import Main_Account_File from '../../Main_Screen_Files/Main_Accont_File'

const Header_Home = () => {
  return (
    <div className="Header_Home_Box">
      <a href="#" className="Header_Home_Box_Logo_Btn">Logo</a>
      <Router>
        <Routes>
        <span className="Header_Home_Box_Navigator_Btn_Box">
          <Route path="/" element={Main_Home_File} className="Header_Home_Box_Home_Btn">Home</Route>
          <Route className="Header_Home_Box_Investment_Btn">Investment</Route>
          <Route className="Header_Home_Box_About_Us_Btn">About Us</Route>
          <Route className="Header_Home_Box_Contact_Us_Btn">Contact Us</Route>
        </span>
        <span className="Header_Home_Box_Home_Section_Box">
          <Route path="/Main_Account_File" element={Main_Account_File} className="Header_Home_Box_Home_Section_Box_Home_Btn">Account</Route>
          <Route className="Header_Home_Box_Home_Section_Box_Profile_Btn"><img src={img} className="Header_Home_Box_Home_Section_Box_Image_Icon"></img></Route>
        </span>
        </Routes>
      </Router>
    </div>
  );
};

export default Header_Home;
